import React from "react";

function Privacy() {
  return (
    <div>
      <h1 className="privacy-policy-main-heading">Privacy Policy</h1>
      <h3 className="privacy-policy-subheading">17 June 2025</h3>
    </div>
  );
}

export default Privacy;
